class Solution:
    # @param {integer[]} nums
    # @return {integer}
    def jump(self, nums):
        if not nums:
            return 0
        nlen = len(nums)
        # nlen is the maximum jumps can ever make
        min_jumps = [0] + [nlen]*(nlen-1)
        # cur - current index
        # before - before minimum jumps
        for cur in xrange(nlen):
            for before in xrange(cur):
                # can jump and find the min jumps
                if cur - nums[before] <= before and min_jumps[before] + 1 < min_jumps[cur]:
                    min_jumps[cur] = min_jumps[before] + 1

        return min_jumps[-1]


